import React from 'react';
import { Link } from 'react-router-dom';
import '../style.css'
import {
  AppBar,
  Toolbar,
  CssBaseline,
  Typography,
  Grid,
  Button
} from '@mui/material';

const Navbar = ({ logout, token }) => {
  return (
    <div className='header'>
      <AppBar position='static'>
        <CssBaseline>
          <Toolbar>
            <Grid container>
              <Typography type="title">
                Stranger's Things
              </Typography>
            </Grid>
            <Grid className='headerLinks'>
              <Typography>
                <Link to='/'><Button
                style={{
                  color:'white',
                  backgroundColor:'red'
                }}>Home</Button></Link>
                <Link to='/posts'><Button
                style={{
                  color:'white',
                  backgroundColor:'red'
                }}>Posts</Button></Link>
                {
                  token ? (
                    <>
                      <Link to='/profile'><Button
                      style={{
                        color:'white',
                        backgroundColor:'red'
                      }}>Profile</Button></Link>
                      <Link to='/' onClick={() => logout()}><Button
                       style={{
                        color:'white',
                        backgroundColor:'red'
                      }}>Logout</Button></Link>
                    </>
                  ) : (
                    <>
                      <Link to='/register'><Button
                       style={{
                        color:'white',
                        backgroundColor:'red'
                      }}>New Account</Button></Link>
                      <Link to='/login'><Button
                      style={{
                        color:'white',
                        backgroundColor:'red'
                      }}>Sign In</Button></Link>
                    </>
                  )
                }
              </Typography>
            </Grid>
          </Toolbar>
        </CssBaseline>
      </AppBar>
    </div>
  )

}

export default Navbar;
